ATENÇÃO! FLORIANÓPOLIS E REGIÃO!

📍 Cursos de PICC (Cofen 258/2001) e Cateterismo Umbilical (Cofen 388/2011), na cidade de Florianópolis/C.

💡 Interessados deixem seus Whats via Inbox!
DATAS:
21/07 – Curso de PICC (19h às 23h)
22/07 – Curso de PICC (08h às 18h)
23/07 – Curso de CATETERISMO UMBILICAL (08h às 18h)

RECURSOS OFERECIDOS:
• Aulas teóricas e práticas;
• Dialogadas; 
• Demonstração de técnicas; 
• Manequins simuladores realísticos; 
• Apostila com CD; 
• Certificado válido em todo território nacional, dado ao final do curso.

Trata-se de habilitações de alta complexidade, muito procuradas no mercado de trabalho! Invista e saia na frente!
